import '../navigation.css';

import {
  BrowserRouter,
  NavLink,
  Route,
  Switch,
  useHistory,
  useParams,
} from "react-router-dom";



class NavBar extends React.Component {
    render() {
      return (
        <div className="App">
          <BrowserRouter>
            <div style={{display:"flex"}}>
              <div className='App-header'>
                <ul className="topNav">
                  <li>
                    <NavLink activeClassName="active" to="/login">
                      Login
                    </NavLink>
                  </li>
                  <li>
                    <NavLink activeClassName="active" to="/basket">
                      Basket
                    </NavLink>
                  </li>
                </ul>
                <ul className="bottomNav">
                  <li>
                    <NavLink exact activeClassName="active" to="/">
                      Home
                    </NavLink>
                  </li>
                  <li>
                    <NavLink activeClassName="active" to="/coffees">
                      Coffees
                    </NavLink>
                  </li>

                  <li>
                    <NavLink activeClassName="active" to="/teas">
                      Teas
                    </NavLink>
                  </li>
                </ul>
                </div>
                <Switch>
                <Route path="/question/:id" component={() => <Quiz/>} />
                <Route path="/about" component={About} />
                <Route path="/" component={Home} />
                </Switch>
                </div>
        </BrowserRouter>
      </div>
    );
  }
}
function Home() {
    return <h2>Home</h2>;
  }

  function Login() {
    return <h2>Login</h2>;
  }

  function Coffees() {
    return <h2>Coffees</h2>;
  }

  function Teas() {
    return <h2>Teas</h2>;
  }

  function Basket() {
    return <h2>Basket</h2>;
  }


export default NavBar
